def ecu_inv(b,a):
	a0=a
	t0=0
	t=1

	q=a/b

	r=a-q*b

	while r>0:
		temp=(t0-q*t)%a0
		t0=t
		t=temp
		a=b
		b=r
		q=a/b
		r=a-q*b

	return t

